Sabyasachi announces the launch of his largest flagship at Veer Nariman Road, off Horniman Circle, Mumbai. Opening on the 18th of April, the store is a living museum and homage to craft, culture and heritage. Even as it is a tribute to Sabyasachi’s Calcutta and the grand inheritance of luxury that belongs to India. 

From housing the largest showcase of Sabyasachi jewellery in the world and an exclusive exhibit from the brand’s archives to a tearoom tucked away behind silk velvet drapes and bringing the brand’s international collection to India for the first time—the store is the most realised iteration of the Sabyasachi experience. 

